import React from "react";

import {
    CssClasses,
    addColorTypeToCssClass,
    bootstrapTitles
} 
from "../../utilities";

export const H1 = props => {
    const classes = new CssClasses();

    addColorTypeToCssClass({
        type: "text",
        classes: classes,
        props, props
    });
    
    props["className"] = classes.toString();

    console.log(props);

    return bootstrapTitles.h1(props);
}
